import logo from './logo.svg';
import './App.css';
import TextField from './components/TextField/TextField';


function App() {
  return (
    <>
    <TextField textVal="BMI" styleClass="text-field"/>    
    <TextField textVal="BMI-2" styleClass="text-field"/>    
    <TextField textVal="BMI-3" styleClass="text-field"/>    
    </>
  );
}

export default App;
